import {
    Link,
    useParams
} from "react-router-dom";
const ParkingDetail = (props) => {
    console.log(props.parkings)
    var dateDiff;
    if (props.parkings.status === 1) {
        dateDiff = calDatetimeDiff(new Date(), new Date(props.parkings.entry));
    }
    return (
        <div className="container-xxl">
            <div className="row">
                <div className="text-center row gy-5">
                    <Link to="/" >
                        <h1 class="display-1">Parking System</h1>
                    </Link>
                </div>

                <div class='row  gy-5 align-items-center'>
                    <div className='row col-xxl  gy-5 ' >
                        <div class="text-center">
                            <h1 >Car parking E-ticket </h1>
                            <br /> <br />
                            <img src={process.env.PUBLIC_URL + "/piccomp/park1.png"} class="rounded mx-auto d-block img-fluid" />
                        </div>
                    </div>

                    <div className='col-xxl' >
                        <div class="container-fluid ">
                            <div class="form-floating mb-3 text-center">
                                {/* Display the article details if article is not None */}
                                {
                                    props.parkings.status === 1 ? (
                                        <div key={props.parkings.id}>
                                            <div>
                                                <h1> Parking Detail of que {props.parkings.id} </h1>
                                            </div>
                                            <p>Parked time</p>
                                            <p> {new Date(props.parkings.entry).toLocaleString()} </p>
                                            <p>Current time</p>
                                            <p>{new Date().toLocaleString()}</p>
                                            <p>Parking period</p>
                                            <p>{dateDiff[0]} Days {dateDiff[1]} Hours {dateDiff[2]} Minutes</p>
                                            {/* <p> { props.parkings.departure } </p> */}
                                            {
                                                props.parkings.departure === 1 ? (
                                                    <Link to="/">
                                                        <button>Back to Home Screen</button>
                                                    </Link>
                                                ) : (
                                                    dateDiff[0] > 0 && dateDiff[1] > 4 ? (
                                                        <Link to={"/" + props.parkings.id + "/qr"}>
                                                            <button>Pay</button>
                                                        </Link>

                                                    ) : (
                                                        <Link to={"/" + props.parkings.id + "/qr"}>
                                                            <button>Create QR Code</button>
                                                        </Link>

                                                    )
                                                )
                                            }
                                        </div>
                                    ) : (
                                        <div>
                                            <h2>ID not found</h2>
                                        </div>
                                    )
                                }
                            </div>

                        </div>
                    </div>
                </div>
            </div>

            {/* ลิสต์ คนที่มาจอด */}
            {/* <ParkingList 
            parkings={parkings} 
            /> */}

        </div>
    )
}

function calDatetimeDiff(current, parked) {
    // get total seconds between the times
    var delta = Math.abs(current - parked) / 1000;

    // calculate (and subtract) whole days
    var days = Math.floor(delta / 86400);
    delta -= days * 86400;

    // calculate (and subtract) whole hours
    var hours = Math.floor(delta / 3600) % 24;
    delta -= hours * 3600;

    // calculate (and subtract) whole minutes
    var minutes = Math.floor(delta / 60) % 60;
    delta -= minutes * 60;

    return [days, hours, minutes];
}

export default ParkingDetail;
